//Dependencies
import React from 'react';
import {render} from 'react-dom';
import {BrowserRouter as Router} from 'react-router-dom';

//Styles
import './styles/index.css';

//Routes
import AppRoutes from './routes';

render(
  <Router>
    <AppRoutes />
  </Router>
  , document.getElementById('root'));
